: 'https://github.com/ctimmerm/axios-mock-adapter/pull/130', 'diff_url': 'https://github.com/ctimmerm/axios-mock-adapter/pull/130.diff', 'patch_url': 'https://github.com/ctimmerm/axios-mock-adapter/pull/130.patch', 'merged_at': None}, 'body': "This PR closes #88 and #129.

Currently, it is possible to expect query params for `GET`, or a specific body for `POST`, but it is impossible to expect specific query params and a specific body.

To solve this, I added a fourth argument to `MockAdapter.prototype[methodName]` (ie. `onPost`, `onGet`), which corresponds to the expected query parameters for the request. This allows matching both a body and parameters for methods that have a body (`PUT`, `POST`, ...).

This is entirely backwards compatible, meaning that we can still match the params for `GET`, `DELETE`, etc... by specifying the expected params as the second argument (in place of the expected body as for `PUT` and `POST` methods). Overall, this PR does not affect the behaviour of the current public api, since it only adds an argument.

This test case demonstrates the new behaviour:
```js
it('can pass a body, query params, and headers to match a handler', function() {
  var headers = {
    Accept: 'application/json, text/plain, */*',
    'Content-Type': 'application/x-www-form-urlencoded',
    'Header-test': 'test-header'
  };
  mock.onPost('/withBodyAndParams', { data: { is: 'passed' }, in: true }, headers, { foo: 'bar', bar: 'baz' }).reply(200);
  
  return instance
    .post('/withBodyAndParams', { data: { is: 'passed' }, in: true }, { headers: headers, params: { foo: 'bar', bar: 'baz' }})
    .then(function(response) {
      expect(response.status).to.equal(200);
    });
});
```

Implementing this required adding the expected request parameters to the `handler` array. All indexes throughout the source were incremented as needed. Then, we check that the params do match in `utils.findHandler`.

I added several new test cases.

I also modified some tests involving matching params, where the expected params were passed inside the `params` key of an object. This was not required, and I'm not sure why the tests passed in the first place. See [this commit](https://github.com/ctimmerm/axios-mock-adapter/commit/b30fe69f1a07bd564f3f75eecbc8cb4b837aeb03).", 'reactions': {'url': 'https://api.github.com/repos/ctimmerm/axios-mock-adapter/issues/130/reactions', 'total_count': 16, '+1': 13, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 3}, 'timeline_url': 'https://api.github.com/repos/ctimmerm/axios-mock-adapter/issues/130/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/ctimmerm/axios-mock-adapter/issues/comments/1049716478', 'html_url': 'https://github.com/ctimmerm/axios-mock-adapter/pull/130#issuecomment-1049716478', 'issue_url': 'https://api.github.com/repos/ctimmerm/axios-mock-adapter/issues/130', 'id': 1049716478, 'node_id': 'IC_kwDOAz2-UM4-kWb-', 'user': {'login': 'mvitz', 'id': 563587, 'node_id': 'MDQ6VXNlcjU2MzU4Nw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/563587?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/mvitz', 'html_url': 'https://github.com/mvitz', 'followers_url': 'https://api.github.com/users/mvitz/followers', 'following_url': 'https://api.github.com/users/mvitz/following{/other_user}', 'gists_url': 'https://api.github.com/users/mvitz/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/mvitz/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/mvitz/subscriptions', 'organizations_url': 'https://api.github.com/users/mvitz/orgs', 'repos_url': 'https://api.github.com/users/mvitz/repos', 'events_url': 'https://api.github.com/users/mvitz/events{/privacy}', 'received_events_url': 'https://api.github.com/users/mvitz/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-02-24T10:35:05Z', 'updated_at': '2022-02-24T10:35:05Z',